ISLAMABAD, Jan 14 (APP):Chairman Senate Syed Yosuf Raza Gillani on Tuesday announced the panel of presiding officers for the 345th Senate session.
The panel, comprising Irfan Siddiqui, Saleem Mandviwalla, and Manzoor Kakar, has been designated to oversee proceedings in the absence of the Chairman and Deputy Chairman.
